import React from 'react';
import * as FiIcons from 'react-icons/fi';

type IconProps = {
  size?: number;
  color?: string;
  className?: string;
};

export const FiHome: React.FC<IconProps> = (props) => <FiIcons.FiHome {...props} />;
export const FiLayout: React.FC<IconProps> = (props) => <FiIcons.FiLayout {...props} />;
export const FiMessageSquare: React.FC<IconProps> = (props) => <FiIcons.FiMessageSquare {...props} />;
export const FiLogOut: React.FC<IconProps> = (props) => <FiIcons.FiLogOut {...props} />;
export const FiLogIn: React.FC<IconProps> = (props) => <FiIcons.FiLogIn {...props} />;
export const FiUserPlus: React.FC<IconProps> = (props) => <FiIcons.FiUserPlus {...props} />;
export const FiSearch: React.FC<IconProps> = (props) => <FiIcons.FiSearch {...props} />;
export const FiStar: React.FC<IconProps> = (props) => <FiIcons.FiStar {...props} />;
export const FiChevronLeft: React.FC<IconProps> = (props) => <FiIcons.FiChevronLeft {...props} />;
export const FiChevronRight: React.FC<IconProps> = (props) => <FiIcons.FiChevronRight {...props} />;
export const FiClock: React.FC<IconProps> = (props) => <FiIcons.FiClock {...props} />;
export const FiEdit: React.FC<IconProps> = (props) => <FiIcons.FiEdit {...props} />;
export const FiArrowLeft: React.FC<IconProps> = (props) => <FiIcons.FiArrowLeft {...props} />;
export const FiFilter: React.FC<IconProps> = (props) => <FiIcons.FiFilter {...props} />;
export const FiPlay: React.FC<IconProps> = (props) => <FiIcons.FiPlay {...props} />;
export const FiTrendingUp: React.FC<IconProps> = (props) => <FiIcons.FiTrendingUp {...props} />;
